import React, { Component } from "react";
import "./App.css";
import Header from "./Components/Header";
import Footer from './Components/Footer';
import About from './Components/About';
// import Resume from './Components/Resume';
// import Contact from './Components/Contact';
// import Testimonials from './Components/Testimonials';
// import Portfolio from './Components/Portfolio';

class App extends Component {
  state = {
    resumeData: {
      "main": {
        "name":"Tan Jia Jun",
        "occupation":"Undergraduate",
        "description":"Here will be your description. Use this to describe what you do or whatever you feel best describes yourself to a potential employer",
        "image":"profilepic.jpg",
        "bio":"I am pursuing computer science in NTU and currently on my final semester of university. Looking for Full-Time/ Internship opportunity from May 2020 onward. " +
        "I am specialise in Artificial Intelligence and Data Science. Did a few projects in the above mentioned field. "+
        "I am also very interested in software engineering opportunities to integrate and expand my skill sets. ",
        "contactmessage":"Here is where you should write your message to readers to have them get in contact with you.",
        "email": "tanjiajun27@hotmail.com",
        "phone": "+65 9779 3727",
        "address":{
          "street":"Toa Payoh",
          "city":"Singapore",
          "state":"Singapore",
          "zip": "311014"
        },
        "resumedownload":"https://github.com/jtan381/JiaJun_OnlineResume/raw/master/Resume.docx",
        "social":[
          {
            "name":"linkedin",
            "url":"https://www.linkedin.com/in/jia-jun-tan-915283a9/",
            "className":"fa fa-linkedin"
          },
          {
            "name":"github",
            "url":"https://github.com/jtan381",
            "className":"fa fa-github"
          },
        ]
      }
    }
  };

  render() {
    return (
      <div className="App">
        {/* <Header todos={this.state.todos}/> */}
        <Header data={this.state.resumeData.main} />
        <About data = {this.state.resumeData.main}/>
        {/* <Footer data = {this.state.resumeData.main}/> */}
      </div>
    );
  }
}

export default App;
